import React from 'react';
import { Container } from 'reactstrap';

const index = () => {
    return (
        <Container>
            <h1>  <marquee>Developer is sleeping </marquee></h1>

            <img src="https://image.shutterstock.com/image-illustration/funny-cartoon-image-man-fallen-260nw-131180630.jpg" alt=""/>

        </Container>
    );
};

export default index;
